from urllib.error import URLError
import requests
from bs4 import BeautifulSoup
from tkinter import *
from tkinter.ttk import *
import urllib.request
from PIL import Image, ImageTk
import io
import base64
import os

URL = "https://www.vlr.gg/event/800/champions-tour-north-america-stage-2-challengers/open-qualifier-2"
DEFAULT = "https://www.vlr.gg/img/vlr/tmp/vlr.png"
# delay = 600
interval = 300000
# interval = 10000
mids = []
mids2 = []
interest = []
imgs = {}
# Base64 encode of icon
ICO = """






































































































"""


def get_config():
    try:
        with open("config.txt") as cfg:
            lines = cfg.readlines()
            lines = [line.rstrip() for line in lines]
            glob = globals()
            glob['URL'] = lines[0]
            glob['interval'] = int(lines[1]) * (60*1000)
            glob['interest'] = lines[2:]
    except Exception:
        return


def get_data(mainframe):

    page = requests.get(URL)
    soup = BeautifulSoup(page.content, "html.parser")
    matches = soup.find_all("a", class_="bracket-item mod-live")
    m1 = soup.find_all("a", class_="bracket-item mod-live mod-last")
    m2 = soup.find_all("a", class_="bracket-item",
                       href=lambda url: url and [i for i in mids if i in url])
    matches.extend(m1)
    for m in m2:
        if m not in matches:
            matches.append(m)

    for widget in mainframe.winfo_children():
        widget.destroy()

    i = 0
    for match in matches:
        mid = match["href"].split('/')[1]
        teams = match.find_all("div", class_="bracket-item-team-name")
        scores = match.find_all("div", class_="bracket-item-team-score")
        tn = [t.find("span").text.strip() for t in teams]
        urls = ["https:" + t.find("img")["src"] for t in teams]
        scores = [s.text.strip() for s in scores]
        if(interest and not [i for i in tn if i in interest]):
            continue

        if tn[0] not in imgs:
            raw_data = ''
            try:
                with urllib.request.urlopen(urls[0]) as connection:
                    raw_data = connection.read()
            except URLError:
                with urllib.request.urlopen(DEFAULT) as connection:
                    raw_data = connection.read()
            im = Image.open(io.BytesIO(raw_data)).convert(
                'RGBA').resize((40, 40))
            image = ImageTk.PhotoImage(im)
            imgs[tn[0]] = image

        if tn[1] not in imgs:
            raw_data = ''
            try:
                with urllib.request.urlopen(urls[1]) as connection:
                    raw_data = connection.read()
            except URLError:
                with urllib.request.urlopen(DEFAULT) as connection:
                    raw_data = connection.read()
            im = Image.open(io.BytesIO(raw_data)).convert(
                'RGBA').resize((40, 40))
            image = ImageTk.PhotoImage(im)
            imgs[tn[1]] = image

        res = f"{tn[0]} {scores[0]} - {scores[1]} {tn[1]}"
        Label(mainframe, image=imgs[tn[0]]).grid(row=i, column=0)
        Label(mainframe, text=res).grid(row=i, column=1)
        Label(mainframe, image=imgs[tn[1]]).grid(row=i, column=2)

        if mid not in mids:
            mids.append(mid)
        elif scores[0] == '2' or scores[1] == '2':
            if mid in mids and mid not in mids2:
                mids2.append(mid)
            elif mid in mids and mid in mids2:
                mids.remove(mid)
                mids2.remove(mid)
        i += 1
        # print(mid)
        # print(res)

    mainframe.after(interval, get_data, mainframe)


def main():
    BG = '#7c8b9b'
    PAD = 3

    get_config()
    # print(URL)
    # print(interval)
    # print(interest)

    icondata = base64.b64decode(ICO)
    temp = "icon.ico"
    file = open(temp, "wb")
    file.write(icondata)
    file.close()

    root = Tk()
    root.title('VCW by ggkross')
    root.wm_iconbitmap(temp)
    os.remove(temp)
    root.configure(background=BG)
    root.columnconfigure(0, weight=1, minsize=40)
    root.columnconfigure(1, weight=1, minsize=180)
    root.columnconfigure(2, weight=1, minsize=40)
    Style().configure("TLabel", padding=PAD,
                      font='segoeui 11', background=BG, foreground='black')
    get_data(root)
    root.mainloop()


if __name__ == '__main__':
    main()
